import propTypes from "prop-types";
import useState from "react";
function App({ name: user_name, age: user_age }) {
  count = 0;
  const [count, setCount] = useState();

  return (
    <div>
      <h1>Count is {count}</h1>
      <button onClick={countUp}>click</button>
    </div>
  );
}

function countUp() {
  setCount(count++);
}
App.propTypes = { name: propTypes.string, age: propTypes.number };
export default App;
